css:
.shell-it-view .check {
  display: flex;
  flex-direction: column;
}
.shell-it-view .query {
  display: flex;
  flex-direction: row;
  align-items: center;
}
.shell-it-view .editor {
  flex-grow: 1;
}
.shell-it-view .checkbox {
  position: relative;
  display: inline-block;
}
.shell-it-view .checkbox.left {
  margin-right: 10px;
}
.shell-it-view .checkbox.right {
  margin-left: 10px;
}
.shell-it-view .spacer {
  flex-basis: 20px;
}
.shell-it-view .prev-command {
  display: flex !important;
  flex-direction: row;
}
.shell-it-view .prev-command.left {
  width: 30px;
  vertical-align: middle;
}
